title: 'Meetup AFUP Rennes de Janvier 2021'
language: French
recordingDate: 1611817085
description: "Bonjour et bonne année a tous,\n\nLe dernier mercredi du mois approche, et comme tous les derniers mercredi des mois impairs, l'AFUP Rennes vous propose un meetup avec conférences.\n\nAu programme une conférence technique et une conférence alien.\n\nFrederic Bouchery nous fera une présentation des nouveautés introduite par composer 2.\n\nPascal Martin viendra nous parler de la boisson chaude préférée des développeurs le café.\n\nOn vous attends en visio sur Placemeet : https://app.placemeet.fr/afup-rennes\n\nL'équipe AFUP de Rennes"
